import React from 'react';
import classes from "./Header.module.css";
import HeaderLogo from './HeaderComponents/HeaderLogo';
import HeaderSearch from './HeaderComponents/HeaderSearch';
import HeaderNotifications from './HeaderComponents/HeaderNotification';

const Header = () => {
    return (
        <header className={classes.header}>
            <HeaderLogo />
            <HeaderSearch />
            <HeaderNotifications />
            <div className={classes.headerMusic}><img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRYkkqwJZSG6lUDXS1DRXpD5Zy_BRzLCO7Xp-hU2yJgX5D6ppEq" alt="music"></img></div>
            <div className={classes.headerProfile}><img src="https://sun9-37.userapi.com/c628321/v628321677/3bc35/Nw-jx5UJK5k.jpg  " alt="logo"></img></div>
        </header>
    );
}

export default Header;
